/** 
 * @param context the context to use
 * @param license the license
 * @return String which contains a HTML formatted license pagestyled according to the context's theme
 */
private static String getFormattedLicense(@NonNull final Context context,@NonNull final License license){
  final StringBuilder licenseContent=new StringBuilder();
  final String webViewData;
  try {
    final BufferedReader in=new BufferedReader(new InputStreamReader(context.getAssets().open(license.getFilename()),StandardCharsets.UTF_8));
    String str;
    while ((str=in.readLine()) != null) {
      licenseContent.append(str);
    }
    in.close();
    webViewData=licenseContent.toString().replace("</head>","<style>" + getLicenseStylesheet(context) + "</style></head>");
  }
 catch (  IOException e) {
    throw new IllegalArgumentException("Could not get license file: " + license.getFilename(),e);
  }
  return webViewData;
}
